import './Posts.css'

function Posts() {


  var https = require('follow-redirects').https;
  var fs = require('fs');

  var options = {
    'method': 'GET',
    'hostname': 'strangers-things.herokuapp.com',
    'path': '/api/2007-LSU-RM-WEB-PT/posts',
    'headers': {
    },
    'maxRedirects': 20
  };

  var req = https.request(options, function (res) {
    var chunks = [];

    res.on("data", function (chunk) {
      chunks.push(chunk);
    });

    res.on("end", function (chunk) {
      var body = Buffer.concat(chunks);
      console.log(body.toString());
    });

    res.on("error", function (error) {
      console.error(error);
    });
  });

  req.end();

  console.log(chunks);

  return (
     Posts.map(() => {
      <h1>{Posts.title}</h1>
    })
  )
}

